import * as React from 'react'
import { Text ,View,Button} from 'react-native'


export default function HomeScreen({navigation}) {
    return (
    	<>
    	<Button
      title="Go to Jane's profile"
      onPress={() =>
        navigation.navigate('SignIn')}
    />
        <View>
                <Text>HomeScreen</Text>
        </View>
        </>
    )
}
